Studio  Vouyer Media  
Release Date  Aug 05, 2009 
Category  All Sex, Interracial, HD - Shot In High Def, Asian 
Director  Zander
Starring  Lana Violet, Asa Akira, Kita Zen, London Keyes, Yuki Mori, Annie Lee 

Whether he's turning his camera loose on such established superstars as Thai beauty LANA VIOLET and sultry Japanese stunner LONDON KEYS, or putting newbies like YUKI MORI through their paces, the director serves up scene after scene of high-end gonzo that's shot and edited for maximum impact. The passion, energy, and excitement never flags, whether the focus is on KITA ZEN's great, deep swallowing blowjob or the furious fuck from ANNIE LEE that delivers some of the movie's raunchiest moments. With costuming that slyly plays on some of the current trends in adult anime and Japanese action cinema, to an intense bonus sequence featuring VM favorite ASA AKIRA, ASIAN ANNIHILATION is a lighthearted exercise in Eastern erotica that's as funny as it is filthy.
